style.css:
@media (prefers-color-scheme: dark) {
	 body, .my-3.my-md-5 {
		 background-color: #111721;
		 color: #b3b3b3 !important;
	}
	 .text-default {
		 color: #b3b3b3 !important;
	}
	 .app-content, .card, .header, .footer {
		 background-color: #1a2332;
	}
	 td {
		 color: #b3b3b3;
	}
	 .tag {
		 background-color: #111721;
		 color: #b3b3b3;
	}
	 .dropdown-menu {
		 background-color: #111721;
	}
	 .dropdown-item {
		 color: #b3b3b3;
	}
	 .nav-item.show .nav-link {
		 background-color: #111721 !important;
		 color: #b3b3b3 !important;
	}
	 .dropdown-item:hover {
		 background-color: #1a2332;
		 color: #b3b3b3;
	}
	 .btn-secondary {
		 background-color: #1cb09a;
		 color: #fff;
	}
	 .btn-secondary:hover {
		 background-color: #199a87;
		 color: #fff;
	}
	 .modal-content {
		 background-color: #1a2332;
	}
	 .selectize-input, .form-control, .custom-file-label {
		 background-color: #111721 !important;
		 color: #b3b3b3 !important;
	}
	 .selectize-control.multi .selectize-input > div {
		 background-color: #199a87 !important;
		 color: #fff !important;
	}
	 .selectize-control.single .selectize-input:after {
		 background: none;
	}
	 span, li, .form-label, p, .modal-title, small {
		 color: #b3b3b3 !important;
	}
	 .btn.cancel, .btn.cancel:active {
		 background-color: #5e0202 !important;
		 color: #b3b3b3 !important;
	}
	 .btn.save, .btn.save:active {
		 background-color: #036003 !important;
		 color: #b3b3b3 !important;
		 border: none;
	}
	 .selectize-dropdown-content .selected {
		 background-color: #0a0f17;
		 color: #b3b3b3 !important;
	}
	 .selectize-dropdown-content .active {
		 background-color: #1a2332;
		 color: #b3b3b3 !important;
	}
	 .nav-tabs, .modal-header {
		 border-bottom: 1px solid #111721;
	}
	 .modal-footer {
		 border-top: 1px solid #111721;
	}
	 .table th, .text-wrap table th, .table td, .text-wrap table td {
		 border-top: 1px solid #111721;
	}
	 .table thead th, .text-wrap table thead th {
		 border-bottom: 1px solid #111721;
	}
	 .dropdown-divider {
		 border-top: 1px solid #1a2332;
	}
	 .btn-outline-secondary:hover i {
		 color: black;
	}
	 .btn-outline-success:hover {
		 color: white !important;
	}
	 .dns-challenge {
		 background-color: #111721;
		 border: none;
	}
	 .dns-challenge .form-control {
		 background-color: #1a2332 !important;
	}
	 .custom-file-label:after {
		 background-color: #1a2332 !important;
		 color: #b3b3b3 !important;
	}
	 .stamp i, .tag-addon {
		 color: black !important;
	}
	 .tag.hover-green:hover, .tag.hover-green:active, .tag.hover-green:focus, .hover-pink:hover {
		 color: white !important;
	}
	 pre {
		 background-color: #111721 !important;
		 text-shadow: none;
		 color: #b3b3b3 !important;
	}
	 .tag.hover-yellow:hover, .tag.hover-yellow:active, .tag.hover-yellow:focus {
		 color: black !important;
	}
	 .custom-control-label, .selectize-dropdown, .selectize-input, .selectize-input input {
		 color: #b3b3b3 !important;
	}
	 .custom-control-label:before {
		 background-color: #111721;
	}
	 .dropdown-menu-arrow:before, .dropdown-menu-arrow:after {
		 display: none !important;
	}
	 .selectgroup-button {
		 background-color: #111721;
	}
	 .selectgroup-input:checked + .selectgroup-button {
		 background-color: #199a87;
		 color: white !important;
	}
	 .custom-switch-indicator {
		 background-color: #111721;
	}
	 .close:before {
		 color: #b3b3b3;
	}
	 .alert-secondary {
		 background-color: #111721;
		 border: none;
		 color: #b3b3b3;
	}
	 .alert-danger {
		 background-color: #5e0202 !important;
		 color: #b3b3b3 !important;
		 border: none;
	}
	 .input-group-text {
		 background-color: #199a87;
		 color: white !important;
	}
}
